// import React from 'react';
import './ProjetosPortfolio.css';

const ProjetosPortfolio = () => {
    return (
        <section id="portfolio" className="portfolio">
            <h2 className="titulo-secao">Portfólio e Projetos</h2>
            <p>Veja alguns dos meus projetos:</p>
            <div className="projetos-lista">
                <div className="projeto-card">
                    {/*<img src="link-imagem-projeto1.jpg" alt="Projeto de Gestão de Academias" className="projeto-imagem"/>*/}
                    <h3>Projeto para Cliente</h3>
                    <p>Sistema de gestão de academias desenvolvido com Node.js e React.</p>
                    <button className="projeto-botao">Ver Mais</button>
                </div>
                <div className="projeto-card">
                    {/*<img src="link-imagem-projeto2.jpg" alt="Portal de Notícias Acadêmico" className="projeto-imagem"/>*/}
                    <h3>Projeto Acadêmico</h3>
                    <p>Portal de notícias para estudos com Java e MySQL.</p>
                    <button className="projeto-botao">Ver Mais</button>
                </div>
            </div>
        </section>
    );
};

export default ProjetosPortfolio;
